package packets

import (
	"bytes"
	"io"
	"math/rand"
	"testing"
)

var cps = make([]ControlPacket, 0)

func BenchmarkNewControlPacket(b *testing.B) {
	rand.Seed(1)
	b.ReportAllocs()
	b.ResetTimer()
	for i := 0; i < b.N; i++ {
		NewControlPacket(byte(rand.Int()%14 + 1)).Close()
	}
}

func BenchmarkParallelNewControlPacket(b *testing.B) {
	rand.Seed(1)
	b.ReportAllocs()
	b.ResetTimer()
	b.RunParallel(func(pb *testing.PB) {
		for pb.Next() {
			NewControlPacket(byte(rand.Int()%14 + 1)).Close()
		}
	})
}

func BenchmarkReadPacket(b *testing.B) {
	b.ReportAllocs()
	b.ResetTimer()
	for i := 0; i < b.N; i++ {
		b.StopTimer()
		f := getRandPack()
		b.StartTimer()
		cp, _ := ReadPacket(f)
		cp.Close()
	}
}

